import React, {Component} from 'react';
import SubTitle from "../SubTitle/SubTitle";
import FirstCertificationPhoto from "http://www.psyholog.rovno.ua/wp-content/uploads/2015/11/sert_psyholog.jpg";
import SecondCertificationPhoto from "http://www.psyholog.rovno.ua/wp-content/uploads/2015/11/vuz_sert1_ps.jpg";
import ThirdCertificationPhoto from "http://www.psyholog.rovno.ua/wp-content/uploads/2015/11/vuz_sert2_ps.jpg";
import FourthCertificationPhoto from "http://www.psyholog.rovno.ua/wp-content/uploads/2015/11/vuz_sert3_ps.jpg";

function AboutCertification(props) {
    const subTitleText='Сертифікати та дипломи';
        return (
            <div className="about-certification">
                <SubTitle text={subTitleText}/>
                <img
                    src={FirstCertificationPhoto}
                    height="40%"
                    width="40%"
                    alt="background"
                />
                <img
                    src={SecondCertificationPhoto}
                    height="40%"
                    width="40%"
                    alt="background"
                />
                <img
                    src={ThirdCertificationPhoto}
                    height="40%"
                    width="40%"
                    alt="background"
                />
                <img
                    src={FourthCertificationPhoto}
                    height="40%"
                    width="40%"
                    alt="background"
                />
            </div>
        );
}

export default AboutCertification;
